import React from 'react';

function Navbar () {
  return (
    <nav class="navbar navbar-light bg-light">
      <a class="navbar-brand" href="#home">Google Books</a>
      <div class="collapse navbar-collapse" id="navbarSupportedContent">
        <h1>Hery</h1>
      </div>
    </nav>
  )
}

export default Navbar;
